INSERT INTO `clima_respuestas_abiertas` VALUES (108, 3, 211, 1, 13, 1, 'EL AMBIENTE LABORAL', '2026-02-04 12:17:27');
INSERT INTO `clima_respuestas_abiertas` VALUES (109, 3, 211, 1, 13, 2, 'LA DISPOSICION DEL COORDINADOR ANALITICO', '2026-02-04 12:17:45');
INSERT INTO `clima_respuestas_abiertas` VALUES (110, 3, 211, 1, 13, 5, 'SER MAS FIRME', '2026-02-04 12:17:57');
INSERT INTO `clima_respuestas_abiertas` VALUES (111, 3, 211, 1, 13, 7, 'LA DIRECCION DE LOS ALTOS MANDOS, EN TRABAJAR CON FECHAS ANTERIORES', '2026-02-04 12:18:16');
INSERT INTO `clima_respuestas_abiertas` VALUES (112, 3, 426, 1, 6, 1, 'El crecimiento multidisciplinario que me ha proporcionado el estar aquí, el liderazgo de mi jefa y su habilidad para dirigir al personal y propiciar su crecimiento', '2026-02-04 12:19:56');
INSERT INTO `clima_respuestas_abiertas` VALUES (113, 3, 426, 1, 6, 2, 'Que la comunicación con las demás áreas se vuelva clara y oportuna, ya que en muchas ocasiones no todas las áreas tienen comunicación efectiva y esto retrasa todos los procesos y actividades', '2026-02-04 12:21:02');
INSERT INTO `clima_respuestas_abiertas` VALUES (114, 3, 426, 1, 6, 5, 'Creo que mi jefa es muy buena líder y nos proporciona tanto el apoyo como el acompañamiento necesario para poder realizar las actividades definidas e impulsa nuestro crecimiento.', '2026-02-04 12:22:41');
INSERT INTO `clima_respuestas_abiertas` VALUES (115, 3, 426, 1, 6, 7, 'Que la comunicación que se da a Gerentes no sea la misma que se baja a los demás niveles, propiciando retrabajos y atrasos, generando reuniones de seguimiento no solo con personal de gerencia sino también tomar las opiniones de las personas para un enfoque multidisciplinado.', '2026-02-04 12:25:30');
INSERT INTO `clima_respuestas_abiertas` VALUES (116, 3, 318, 1, 10, 1, 'La comprensión, flexibilidad y apoyo por parte de mi jefe directo, el compañerismo y el trato con respeto.', '2026-02-04 12:23:34');
INSERT INTO `clima_respuestas_abiertas` VALUES (117, 3, 360, 1, 6, 1, 'Se me permite un cierto grado de toma de decisiones', '2026-02-04 12:24:06');
INSERT INTO `clima_respuestas_abiertas` VALUES (118, 3, 318, 1, 10, 2, 'El reconocimiento del área por la importancia y trabajo que hace, y no por un cumplimiento legal/normativo. Así como más apoyo al área y un mejor salario, ya que a veces las responsabilidades superan los límites y no nos damos abasto.', '2026-02-04 12:25:30');
INSERT INTO `clima_respuestas_abiertas` VALUES (121, 3, 404, 1, 2, 1, 'El apoyo brindado por el equipo', '2026-02-04 12:25:46');
INSERT INTO `clima_respuestas_abiertas` VALUES (122, 3, 318, 1, 10, 5, 'En realidad, nada. Se trabaja muchas veces con lo que se tiene, pero ayudaría una mejor gestión de recursos y más libertas al momento de tomar decisiones.', '2026-02-04 12:26:32');
INSERT INTO `clima_respuestas_abiertas` VALUES (123, 3, 424, 1, 4, 1, 'Flexibilidad y facilidad para trabajar a mi ritmo', '2026-02-04 12:26:38');
INSERT INTO `clima_respuestas_abiertas` VALUES (124, 3, 176, 1, 4, 1, 'Que la carga de trabajo es adecuada para tener un balance y no sentirse estresado, además de que el equipo de trabajo es amigable', '2026-02-04 12:26:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (125, 3, 424, 1, 4, 2, 'Agilizar los pagos a proveedores que es lo que retrasa en gran medida el trabajo del área de metrología', '2026-02-04 12:27:26');
INSERT INTO `clima_respuestas_abiertas` VALUES (126, 3, 404, 1, 2, 2, 'La convivencia, ya que la comunicación es limitada. y mejoría salarial porque so demandantes las actividades', '2026-02-04 12:27:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (127, 3, 360, 1, 6, 2, 'Formas más claras para solicitar y ejecutar pagos usando SAP por que es un sistema que se puede seguir y consultar en tiempo real', '2026-02-04 12:27:41');
INSERT INTO `clima_respuestas_abiertas` VALUES (128, 3, 424, 1, 4, 5, 'Presionar mas al área de compras para gestionar los pagos de forma oportuna', '2026-02-04 12:27:52');
INSERT INTO `clima_respuestas_abiertas` VALUES (129, 3, 176, 1, 4, 2, 'Que el enviar instrumentos con proveedores no sea un tema de retraso pues actualmente contamos en el área con un atraso considerable de un año por falta de pagos a proveedores, a pesar de que las facturas emitidas por los mismos se mandan al área correspondiente en tiempo y forma.', '2026-02-04 12:27:55');
INSERT INTO `clima_respuestas_abiertas` VALUES (130, 3, 404, 1, 2, 5, 'Hasta el momento ninguna, no he tenido problema alguno.', '2026-02-04 12:28:04');
INSERT INTO `clima_respuestas_abiertas` VALUES (131, 3, 424, 1, 4, 7, 'Hacer menos burocrático el proceso de pagos a proveedores', '2026-02-04 12:28:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (132, 3, 176, 1, 4, 5, 'Meter más presión al área encargada de la gestión de pagos para que se realicen los pagos correspondientes y evitar atrasos.', '2026-02-04 12:28:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (133, 3, 360, 1, 6, 5, 'Establecer claramente los objetivos y las metricas a utilizar, siendo consistente con la capacidad de la empresa', '2026-02-04 12:28:45');
INSERT INTO `clima_respuestas_abiertas` VALUES (134, 3, 404, 1, 2, 7, 'Como tal no hay obstáculos, simplemente la comunicación no es buena, tanto en mi área como en otras.', '2026-02-04 12:28:52');
INSERT INTO `clima_respuestas_abiertas` VALUES (135, 3, 79, 1, 8, 1, 'Qué puedo desarrollar mis habilidades y aplicar mis conocimientos adquiridos', '2026-02-04 12:28:53');
INSERT INTO `clima_respuestas_abiertas` VALUES (136, 3, 176, 1, 4, 7, 'La falta de pagos, somos  un área que depende de las calibraciones de patrones con proveedores para asegurar la calibración de los demás instrumentos pertenecientes a Farmacéutica Hispanoamericana, por lo que la falta de los pagos es un impedimento al cumplimiento Normativo lo cual nos ha generado un atraso de un año en instrumentos claves como son los manómetros diferenciales presentes en las áreas de producción tanto aerosoles como farma.', '2026-02-04 12:30:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (137, 3, 360, 1, 6, 7, 'La ejecución de actividades es poco clara, se necesita de un sistema para consultar los procedimientos de cada área y como se deben ejecutar las actividades que sea disponible facilmente', '2026-02-04 12:30:51');
INSERT INTO `clima_respuestas_abiertas` VALUES (138, 3, 79, 1, 8, 2, 'El trato que recibimos por parte de algunas personas que ostentan una posición de poder, porqué incomodan al realizar tu trabajo', '2026-02-04 12:31:14');
INSERT INTO `clima_respuestas_abiertas` VALUES (139, 3, 79, 1, 8, 5, 'La comuicación', '2026-02-04 12:31:30');
INSERT INTO `clima_respuestas_abiertas` VALUES (140, 3, 36, 1, 13, 1, 'El trabajo en equipo', '2026-02-04 12:31:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (141, 3, 36, 1, 13, 2, 'capacitaciones continuas', '2026-02-04 12:31:53');
INSERT INTO `clima_respuestas_abiertas` VALUES (142, 3, 180, 1, 13, 1, 'A mis compañeros de trabajo', '2026-02-04 12:32:15');
INSERT INTO `clima_respuestas_abiertas` VALUES (143, 3, 36, 1, 13, 5, 'la comunicación, delega demasiado y termina olvidando detalles', '2026-02-04 12:33:14');
INSERT INTO `clima_respuestas_abiertas` VALUES (144, 3, 79, 1, 8, 7, 'Hay personas que no les gusta asumir la responsabilidad de las tareas que exige su puesto de trabajo, y buscan culpar a otros de los errores que pudieran surgir en los procesos.', '2026-02-04 12:33:23');
INSERT INTO `clima_respuestas_abiertas` VALUES (145, 3, 98, 1, 13, 1, 'Mi equipo se organiza para poder sacar adelante el trabajo, aunque algunos aporten un poco mas que otro.', '2026-02-04 12:42:52');
INSERT INTO `clima_respuestas_abiertas` VALUES (146, 3, 110, 1, 13, 2, 'El salario', '2026-02-04 12:50:16');
INSERT INTO `clima_respuestas_abiertas` VALUES (147, 3, 98, 1, 13, 5, 'Que cuente con cursos de liderazgo para que pueda venir a darnos en persona los comunicados o informarnos sobre las actividades, así como que se mantenga más al pendiente del trabajo de mis compañeros y mio en forma presencial en lugar de guiarse solamente por una plataforma que no refleja realmente el trabajo, que conteste de manera oportuna los mensajes debido a que tiene compañeros en horarios diferentes y es necesario a veces contestar los problemas del area, cuando realice evaluaciones que nos retroalimente sobre nuestras fallas y puntos de mejora y no solamente hacernos firmarla, que se involucre un poco más en el trabajo del personal no delegando sus funciones a otro.', '2026-02-04 12:37:59');
INSERT INTO `clima_respuestas_abiertas` VALUES (148, 3, 390, 1, 2, 1, 'El desarrollo profesional', '2026-02-04 12:38:35');
INSERT INTO `clima_respuestas_abiertas` VALUES (149, 3, 390, 1, 2, 2, 'Resolución de problemas enfocado a resultados', '2026-02-04 12:39:26');
INSERT INTO `clima_respuestas_abiertas` VALUES (150, 3, 390, 1, 2, 7, 'Los seguimientos a los procesos una orden de compra', '2026-02-04 12:40:31');
INSERT INTO `clima_respuestas_abiertas` VALUES (151, 3, 98, 1, 13, 7, 'Realizar reuniones con los jefes de todas las areas en donde se informe sobre las futuras actividades o producciones para asi poder organizarnos nosotros con un poco mas de tiempo para poder enfocarnos mas en varias actividades y no quedarnos atrapados en una sola.', '2026-02-04 12:40:54');
INSERT INTO `clima_respuestas_abiertas` VALUES (152, 3, 154, 1, 4, 1, 'Aportar mi granito de arena para que las cosas funcionen de manera fluida', '2026-02-04 12:41:03');
INSERT INTO `clima_respuestas_abiertas` VALUES (153, 3, 98, 1, 13, 2, 'La coordinacion, o incluir un puesto mas al area para ayudar a la carga del jefe en la forma de organizar y revisar las cosas.', '2026-02-04 12:42:50');
INSERT INTO `clima_respuestas_abiertas` VALUES (155, 3, 154, 1, 4, 2, 'claridad en los procesos para no trabajar por urgencias o estar corriendo por que a alguien se le paso algo', '2026-02-04 12:43:05');
INSERT INTO `clima_respuestas_abiertas` VALUES (156, 3, 11, 1, 6, 1, 'La oprtunidad de que mis ideas sean tomadas en cuenta', '2026-02-04 12:43:57');
INSERT INTO `clima_respuestas_abiertas` VALUES (157, 3, 11, 1, 6, 2, 'los procesos largos y un poco burocráticos', '2026-02-04 12:44:12');
INSERT INTO `clima_respuestas_abiertas` VALUES (158, 3, 110, 1, 13, 5, 'La comunicación con los miembros de su equipo, porque a veces no es clara, precisa y seria. También debe de ver el bienestar (salario) y crecimiento de su área y miembros de su equipo.', '2026-02-04 12:50:23');
INSERT INTO `clima_respuestas_abiertas` VALUES (159, 3, 154, 1, 4, 5, 'Su forma de manejar al personal y la toma de decisiones en pro de la compañía', '2026-02-04 12:44:30');
INSERT INTO `clima_respuestas_abiertas` VALUES (160, 3, 11, 1, 6, 5, 'Priorizacion y planificación de tareas', '2026-02-04 12:44:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (161, 3, 11, 1, 6, 7, 'Falta de actitud de servicio y planes de acciones para lograr el resultado esperado', '2026-02-04 12:45:06');
INSERT INTO `clima_respuestas_abiertas` VALUES (162, 3, 154, 1, 4, 7, 'la información no fluye de manera asertiva entre las gerencias y hacia abajo se generan urgencias', '2026-02-04 12:45:49');
INSERT INTO `clima_respuestas_abiertas` VALUES (163, 3, 110, 1, 13, 7, 'Que parece que no tienen una coordinación entre áreas, no se si sea falta de comunicación o falta de interés en las cosas que solicitan.\nTambién afecta que la empresa no tenga coherencia entre las necesidades básicas importantes (equipos calificados, insumos e instalaciones) y las no importantes (Comedor).', '2026-02-04 12:48:53');
INSERT INTO `clima_respuestas_abiertas` VALUES (164, 3, 171, 1, 13, 1, 'Que mis compañeros de trabajo piden mi opinión para resolver problemas con sus actividades.', '2026-02-04 12:57:49');
INSERT INTO `clima_respuestas_abiertas` VALUES (165, 3, 38, 1, 4, 2, 'El presupuesto que asignan al área. La falta de presupuesto evita que se paguen a tiempo el mantenimiento de los equipos, hay retrasos en la entrega de reactivos, no hay suficiente material.', '2026-02-04 13:02:08');
INSERT INTO `clima_respuestas_abiertas` VALUES (166, 3, 110, 1, 13, 1, 'mmmm quizás en ambiente con mis compañeros de área que nos llevamos bien fuera del trabajo', '2026-02-04 12:49:37');
INSERT INTO `clima_respuestas_abiertas` VALUES (167, 3, 171, 1, 13, 2, 'El salario porque no gano lo mismo que mis compañeros a pesar de tener las mismas actividades y mismo puesto.', '2026-02-04 13:00:27');
INSERT INTO `clima_respuestas_abiertas` VALUES (171, 3, 38, 1, 4, 5, 'Tener un mejor manejo del personal.', '2026-02-04 12:57:31');
INSERT INTO `clima_respuestas_abiertas` VALUES (173, 3, 42, 1, 13, 1, 'las prestaciones y el salario', '2026-02-04 12:52:12');
INSERT INTO `clima_respuestas_abiertas` VALUES (174, 3, 42, 1, 13, 2, 'mejor equipo de seguridad', '2026-02-04 12:53:29');
INSERT INTO `clima_respuestas_abiertas` VALUES (175, 3, 171, 1, 13, 7, '', '2026-02-04 12:59:14');
INSERT INTO `clima_respuestas_abiertas` VALUES (177, 3, 180, 1, 13, 2, 'Mayor abasto e material', '2026-02-04 12:55:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (178, 3, 180, 1, 13, 7, '', '2026-02-04 12:55:41');
INSERT INTO `clima_respuestas_abiertas` VALUES (181, 3, 180, 1, 13, 5, 'Calificaciones y calibraciones de equipos', '2026-02-04 12:55:29');
INSERT INTO `clima_respuestas_abiertas` VALUES (182, 3, 42, 1, 13, 5, 'dar un poco mas de seguimiento a las necesidades del laboratorio', '2026-02-04 12:55:32');
INSERT INTO `clima_respuestas_abiertas` VALUES (185, 3, 42, 1, 13, 7, 'hay muchos desacuerdos', '2026-02-04 12:56:44');
INSERT INTO `clima_respuestas_abiertas` VALUES (186, 3, 181, 1, 13, 7, '', '2026-02-04 12:56:56');
INSERT INTO `clima_respuestas_abiertas` VALUES (187, 3, 82, 1, 4, 1, 'La estabilidad y el horario de trabajo, las prestaciones', '2026-02-04 12:57:03');
INSERT INTO `clima_respuestas_abiertas` VALUES (188, 3, 38, 1, 4, 7, 'Las solicitudes de parte de algunas otras áreas no se hacen con anticipación, las cosas solicitadas no todas las veces son claras, solicitan resultados a la brevedad y no consideran que tenemos mas trabajo, no aceptan sus errores para poder mejorar.', '2026-02-04 12:57:13');
INSERT INTO `clima_respuestas_abiertas` VALUES (192, 3, 171, 1, 13, 5, 'Debe imponer su autoridad como jefe y no permitir la insubordinación.', '2026-02-04 12:58:49');
INSERT INTO `clima_respuestas_abiertas` VALUES (195, 3, 136, 1, 2, 1, 'Valoro la relevancia de los proyectos que manejamos. Sentir que el trabajo impacta directamente en los resultados de la empresa me da un propósito claro.', '2026-02-04 13:00:22');
INSERT INTO `clima_respuestas_abiertas` VALUES (198, 3, 82, 1, 4, 2, 'considero relevante promover un trato equitativo entre el personal de corporativo y de planta, evitando diferencias que puedan percibirse como discriminación y reforzando una cultura organizacional basada en el respeto', '2026-02-04 13:53:54');
