INSERT INTO `clima_respuestas_abiertas` VALUES (201, 3, 136, 1, 2, 2, 'Optimizaría la digitalización de ciertos procesos manuales. Actualmente, se invierte mucho tiempo en tareas administrativas que podrían automatizarse, permitiéndonos enfocarnos en actividades de mayor valor estratégico.', '2026-02-04 13:01:33');
INSERT INTO `clima_respuestas_abiertas` VALUES (206, 3, 494, 1, 13, 1, 'El aprendizaje y condiciones para la mejora continua de los procesos que se realizan internamente.', '2026-02-04 13:03:19');
