INSERT INTO `clima_respuestas_abiertas` VALUES (208, 3, 136, 1, 2, 5, 'Me ayudaría mucho tener una mayor visibilidad sobre las prioridades a largo plazo. A veces las urgencias del día a día nublan los objetivos estratégicos, y una guía clara sobre qué priorizar me permitiría gestionar mejor mi tiempo.', '2026-02-04 13:05:25');
INSERT INTO `clima_respuestas_abiertas` VALUES (209, 3, 136, 1, 2, 7, 'Los tiempos de respuesta entre áreas y el uso de canales de comunicación informales para solicitudes críticas, no corresponden a los definidos por acuerdos y/o politicas.\nLa solución: \"Propongo establecer un protocolo de entrega estandarizado o una herramienta de gestión compartida (como Jira o Asana). De esta forma, cada área sabe qué se necesita de ella, cuándo se requiere y qué prioridad tiene, evitando los cuellos de botella por falta de información.\"', '2026-02-04 13:07:49');
INSERT INTO `clima_respuestas_abiertas` VALUES (210, 3, 494, 1, 13, 7, 'Considero que debería haber una mayor concientización sobre la importancia del trabajo de cada área. Considerando el crecimiento de FH, debería implementarse un cambio de las políticas y filosofia', '2026-02-04 13:20:01');
INSERT INTO `clima_respuestas_abiertas` VALUES (211, 3, 494, 1, 13, 5, 'No tengo observación alguna actualmente. Sin embargo, considero que es necesario mayor independencia del área y su segmentación.', '2026-02-04 13:16:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (213, 3, 418, 1, 13, 1, 'Que mis actividades se me comunican de forma clara y precisa, además el grupo de trabajo me apoya cuando tengo inquietudes sobre las actividades del área', '2026-02-04 13:07:08');
INSERT INTO `clima_respuestas_abiertas` VALUES (220, 3, 418, 1, 13, 2, 'Tener oficinas propias y que la comunicación entra áreas sea más efectiva.', '2026-02-04 13:16:42');
INSERT INTO `clima_respuestas_abiertas` VALUES (222, 3, 418, 1, 13, 7, 'Que puedes pedir documentación o evidencia cual sea y se tienen fechas compromiso y no se cumplen. Además, también en coordinación de actividades se dio tiempos y fechas y al llegar a realizarlo no se encuentra el espacio, equipo o el personal a cargo no está enterado y eso retrasa demasiado.', '2026-02-04 13:17:13');
INSERT INTO `clima_respuestas_abiertas` VALUES (226, 3, 418, 1, 13, 5, 'Coordinar eficientemente las actividades que se requieren en otras áreas.\nTener una comunicación clara con otras áreas, ya que algunas veces hay mal entendidos entre áreas.', '2026-02-04 13:16:37');
