INSERT INTO `clima_respuestas_abiertas` VALUES (335, 3, 204, 1, 13, 7, '', '2026-02-04 15:48:27');
INSERT INTO `clima_respuestas_abiertas` VALUES (337, 3, 29, 1, 13, 5, 'Dejar de generar conflictos de interés que complican las situaciones que se deben de resolver objetivamente, dejar de dar indicaciones verbalmente e incluirlas en documentos del sistema como los procedimientos. La promoción de amistades y relaciones personales entre los colaboradores deriva en la creación de mafias que se coluden para obtener beneficios personales que no coinciden con los que necesita la empresa.', '2026-02-04 15:57:29');
INSERT INTO `clima_respuestas_abiertas` VALUES (338, 3, 85, 1, 2, 5, 'que se cumpla con lo indicado, cuando se platica de ajustes de sueldo, se cambian responsabilidades sin realizar el ajuste platicado', '2026-02-04 15:49:10');
INSERT INTO `clima_respuestas_abiertas` VALUES (339, 3, 85, 1, 2, 7, '', '2026-02-04 15:49:17');
INSERT INTO `clima_respuestas_abiertas` VALUES (340, 3, 29, 1, 13, 7, 'El principal obstáculo de comunicación entre áreas es la búsqueda de culpables en las oportunidades de mejora que tiene cada operación, esto por el temor excesivo a una sanción que puede incluir la pérdida del empleo.\nSe resuelve promoviendo la diferencia entre oportunidad de mejora y conducta de los empleados, una se mide, la otra se evalúa, ninguna de las dos se juzga.\nEste obstáculo deriva de la falta de políticas claras y consistentes que permitan conocer la conducta que la empresa espera de sus empleados, actualmente estas políticas quedan a criterio y/o conveniencia de los mandos.', '2026-02-04 15:55:14');
INSERT INTO `clima_respuestas_abiertas` VALUES (352, 3, 265, 1, 10, 1, 'Que mi jefe inmediato nos permite proporner, nos deja trabajar sin involucarse de manera negativa, nos invita a la mejora continua y nos da libertad del ejercicio de nuestras labores.', '2026-02-04 16:05:09');
INSERT INTO `clima_respuestas_abiertas` VALUES (353, 3, 6, 1, 13, 1, 'El trabajo en equipo dentro de mi área', '2026-02-04 16:04:06');
INSERT INTO `clima_respuestas_abiertas` VALUES (354, 3, 6, 1, 13, 2, 'Homologar las condiciones de trabajo en los diferentes sitios de trabajo, ya que en algunas ubicaciones se adquieren muebles nuevos y en otras ubicaciones se caen a pedazos las instalaciones, hecho que genera inconformidad en el personal, adicional, integrar a todo el personal en las diferentes actividades que organiza la empresa, ya que el hecho de generar o incluir solo al personal de ciertas áreas o ubicaciones desmotiva al personal que no es considerado.', '2026-02-04 16:05:57');
INSERT INTO `clima_respuestas_abiertas` VALUES (355, 3, 265, 1, 10, 7, 'Algunos jefes de otros departamentos no pueden tomar la desición de quien elegir para su equipo, es decir, en ocaciones un becario pasa por hasta 3 entrevistas, entorpeciendo el tiempo de respuesta para la cobertura de la vacante. En otras ocaciones cancelan las entrevistas de trabajo, haciendo que el candidato decline despues de dos entrevistas previas y no dan un seguimiento oportuno.', '2026-02-04 16:04:00');
INSERT INTO `clima_respuestas_abiertas` VALUES (357, 3, 265, 1, 10, 5, 'Hasta el momento mi jefe Antonio, nos ha brindado la infirmación y/o apoyo de manera constante.', '2026-02-04 16:04:38');
INSERT INTO `clima_respuestas_abiertas` VALUES (359, 3, 265, 1, 10, 2, 'Mi sueldo bajo.', '2026-02-04 16:05:25');
