INSERT INTO `clima_respuestas_abiertas` VALUES (364, 3, 39, 1, 13, 7, 'Las áreas relacionadas con el sistema de gestión de calidad de FH ubicadas en corporativo no contestan las solicitudes de aseguramiento de calidad (auditorias internas y temas relacionados con proveedores y maquiladores) lo que dificulta que podamos realizar nuestras actividades de manera puntual.', '2026-02-04 16:09:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (365, 3, 39, 1, 13, 1, 'Puedo tener un equilibrio adecuado entre trabajo y vida personal.', '2026-02-04 16:10:01');
INSERT INTO `clima_respuestas_abiertas` VALUES (366, 3, 6, 1, 13, 7, 'Considero que el tener diferentes ubicaciones dificulta la comunicación oportuna, pese a que existen reuniones virtuales o medios telefónicos, en ocasiones  hay fallas con la red o línea telefónica. Adicional, el caer en exceso de reuniones limita la disponibilidad de algunas personas para poder revisar algún tema, recabar firmas, entre otros.', '2026-02-04 16:12:39');
