INSERT INTO `clima_respuestas_abiertas` VALUES (393, 3, 10, 1, 6, 7, 'La comunicación efectiva entre áreas y el compromiso de cumplir los acuerdos pactados.\nMi propuesta es que existan minutas de todas las reuniones entre áreas, y que todos los empleados nos comprometamos a cumplir en tiempo y forma con los objetivos establecidos.', '2026-02-04 16:42:10');
INSERT INTO `clima_respuestas_abiertas` VALUES (394, 3, 1, 1, 10, 1, 'El reto y la oportunidad de crecer.', '2026-02-04 16:58:01');
INSERT INTO `clima_respuestas_abiertas` VALUES (395, 3, 1, 1, 10, 2, 'Mejorar canales de comunicacion.', '2026-02-04 16:58:10');
INSERT INTO `clima_respuestas_abiertas` VALUES (396, 3, 1, 1, 10, 5, 'Todo bien.', '2026-02-04 16:58:20');
INSERT INTO `clima_respuestas_abiertas` VALUES (397, 3, 1, 1, 10, 7, 'existen diversos, hay mucho que mejorar.', '2026-02-04 16:58:30');
INSERT INTO `clima_respuestas_abiertas` VALUES (398, 3, 313, 1, 2, 1, 'El trabajar con personas que entenderán los puntos de mejora de cada proceso y harán las observaciones necesarias para lograr un cambio.', '2026-02-04 17:04:12');
INSERT INTO `clima_respuestas_abiertas` VALUES (399, 3, 313, 1, 2, 2, 'COMUNICACIÓN.  La comunicación respetuosa y oportuna son la base de éxito en cualquier interacción.', '2026-02-04 17:06:05');
INSERT INTO `clima_respuestas_abiertas` VALUES (400, 3, 313, 1, 2, 5, 'Entender las necesidades del área', '2026-02-04 17:06:42');
INSERT INTO `clima_respuestas_abiertas` VALUES (401, 3, 313, 1, 2, 7, 'Comunicación inmediata. Una herramienta muy buena es Teams. Se pueden crear grupos de trabajo, compartir archivos de forma inmediata, almacenaje en la nube y comunicación instantánea.', '2026-02-04 17:07:47');
INSERT INTO `clima_respuestas_abiertas` VALUES (402, 3, 105, 1, 13, 1, 'El ambiente laboral dentro de mi equipo de trabajo', '2026-02-04 17:10:12');
INSERT INTO `clima_respuestas_abiertas` VALUES (403, 3, 105, 1, 13, 2, 'Qué las áreas externas a la mía se tomen en serio el trabajo y no solo se le dé prioridad a otras, sin ver el impacto.', '2026-02-04 17:10:59');
INSERT INTO `clima_respuestas_abiertas` VALUES (405, 3, 105, 1, 13, 5, 'Bajar la información en tiempo.', '2026-02-04 17:11:18');
INSERT INTO `clima_respuestas_abiertas` VALUES (406, 3, 105, 1, 13, 7, 'El pensamiento de que calidad solo es para molestar, al contrario, al tener buena comunicación entre todos y no solo entre los intereses internos de las áreas, nos evitariamos muchos incumplimientos.', '2026-02-04 17:13:13');
INSERT INTO `clima_respuestas_abiertas` VALUES (410, 3, 112, 1, 13, 1, 'Libertad para organizar mis actividades mensuales\nQue casi no tengo que quedarme tiempo extra solo por estar en la oficina', '2026-02-04 17:25:29');
INSERT INTO `clima_respuestas_abiertas` VALUES (411, 3, 112, 1, 13, 2, 'Horarios fijos de trabajo, por que en ocaciones no podemos llegar a tiempo sin embargo si el horario se apertura a periodos de tiempo (por ejemplo de 8:30 a 10:30) y cumplico con las horas de trabajo sin tener retardos (por ejemplo llegue 8:30 me voy 17:30 pero si llegue a las 9:30 me voy 18:30) seria una buena forma de que los empleados nos sintamos mas tranquilos sin estresarnos en tener que llegar a tiempo para evitar un retardo.', '2026-02-04 17:32:26');
INSERT INTO `clima_respuestas_abiertas` VALUES (412, 3, 112, 1, 13, 5, 'La comunicación de la información respecto a actividades que se realizaran ya que en ocasiones dicha informacion ya se tiene pero no se informa a todo el personal involucrado lo cual genera confusiones a la hora de tener que realizar dichas actividades.', '2026-02-04 17:24:23');
INSERT INTO `clima_respuestas_abiertas` VALUES (414, 3, 112, 1, 13, 7, 'Que cuando se solicita la informacion a los jefes y/o encargados de otras áreas (via correo electronico) no contestan los correos ni derivan a algun subordinado lo cual ha propiciado que no pueda realizar o se retrasen mis actividades, ya que me avisan dias despues de que ya se realizo la actividad que estaba esperando para hacer algun chequeo/monitoreo/revisión.', '2026-02-04 17:32:22');
INSERT INTO `clima_respuestas_abiertas` VALUES (416, 3, 414, 1, 13, 1, 'Valoro que mi jefe tenga el conocimiento sobre el área y nos proporcione dicho conocimiento para poder ejecutar de manera eficiente el trabajo en la empresa, esto me ha servido de mucha ayuda para mí crecimiento profesional.', '2026-02-04 23:31:03');
INSERT INTO `clima_respuestas_abiertas` VALUES (417, 3, 414, 1, 13, 2, 'Mejoraría los horarios laborales.', '2026-02-04 23:34:16');
INSERT INTO `clima_respuestas_abiertas` VALUES (418, 3, 414, 1, 13, 5, 'Solicitar un correo específicamente para el área de inspección de procesos y el acceso a una computadora para realizar algún reporte o actividad realizada durante el turno de nuestro trabajo.', '2026-02-04 23:45:06');
INSERT INTO `clima_respuestas_abiertas` VALUES (420, 3, 414, 1, 13, 7, 'Un obstáculo de comunicación es que no tenemos un correo para el área de inspección y la solución sería que tuviéramos un correo para el área de inspección de procesos para estar comunicados entre las áreas correspondientes y así evitar hallazgos.', '2026-02-04 23:42:53');
