INSERT INTO `clima_respuestas_abiertas` VALUES (427, 3, 232, 1, 13, 2, 'Mejorar salario conforme a las actividades realizadas, incentivos de motivación. Reconocimiento del esfuerzo', '2026-02-05 08:22:42');
