INSERT INTO `clima_respuestas_abiertas` VALUES (437, 3, 115, 1, 12, 5, 'Considero que mi jefa tiene buen liderazgo y enfoque a resultados, se interesa por su personal y recompensa el trabajo bien hecho.', '2026-02-05 08:34:16');
