INSERT INTO `clima_respuestas_abiertas` VALUES (442, 3, 402, 1, 12, 5, 'Solicitar mayores recursos para atender la falta de infraestructura (equipos, disponibilidad de insumos y equipo de seguridad) del área de desarrollo', '2026-02-05 08:36:38');
INSERT INTO `clima_respuestas_abiertas` VALUES (445, 3, 402, 1, 12, 7, 'La', '2026-02-05 08:38:54');
INSERT INTO `clima_respuestas_abiertas` VALUES (446, 3, 436, 1, 12, 2, 'Inclusión del comedor, ya que es una zona muy cara y nos ayudaría a comer de mejor manera.', '2026-02-05 08:36:50');
INSERT INTO `clima_respuestas_abiertas` VALUES (447, 3, 115, 1, 12, 7, 'Que cuando se hacen con otras áreas reuniones en línea o presenciales se lleguen a acuerdos y después se tome otra decisión llevando a retrabajos, se podría solucionar con Minutas de cada reunión. El TEAMS empresarial permite esa función, podría tomarse en cuenta para el caso de reuniones en línea.', '2026-02-05 08:37:00');
INSERT INTO `clima_respuestas_abiertas` VALUES (448, 3, 436, 1, 12, 1, 'El compañerismo ya que en el área están dispuestos a ayudar sin que se los solicites, el apoyo de jefes y gerente también es fundamental ya que nos apoyan para sacar adelante el trabajo', '2026-02-05 08:55:12');
INSERT INTO `clima_respuestas_abiertas` VALUES (451, 3, 436, 1, 12, 5, 'Que nos dé más libertad en cuanto al trabajo ya que a veces no delega el trabajo y él mismo se sobresatura del mismo y que cuando requiera ayuda lo solicite a alguno de nosotros.', '2026-02-05 08:56:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (452, 3, 283, 1, 12, 1, 'La independencia que mi jefa directa me brinda para realizar mi trabajo.', '2026-02-05 08:57:37');
INSERT INTO `clima_respuestas_abiertas` VALUES (453, 3, 283, 1, 12, 2, 'El liderazgo por parte de las cabezas del área', '2026-02-05 08:58:02');
INSERT INTO `clima_respuestas_abiertas` VALUES (454, 3, 283, 1, 12, 7, 'La falta de comunicación efectiva de los coordinadores hacia sus subordinados.', '2026-02-05 09:00:51');
INSERT INTO `clima_respuestas_abiertas` VALUES (456, 3, 283, 1, 12, 5, 'Ser más firme en decisiones que afectan al área', '2026-02-05 09:00:10');
INSERT INTO `clima_respuestas_abiertas` VALUES (459, 3, 83, 1, 13, 1, 'Esto es un cliché, pero solo valoro el pago, no hay mas en esta área.', '2026-02-05 09:14:46');
INSERT INTO `clima_respuestas_abiertas` VALUES (461, 3, 75, 1, 10, 5, 'Que trate su síndrome SAPO ( (Soberbia, Arrogancia, Prepotencia, Obstinación) desde que tiene un puesto que no es de ella.', '2026-02-05 09:18:07');
INSERT INTO `clima_respuestas_abiertas` VALUES (462, 3, 83, 1, 13, 2, 'Que los jefes sean emocionalmente estables, que no te hablen como si estuvieran hablando con un tonto.', '2026-02-05 09:39:50');
INSERT INTO `clima_respuestas_abiertas` VALUES (466, 3, 75, 1, 10, 7, 'Afecta en la comunicación de las visitas, la gente no atiende sus exenciones.', '2026-02-05 09:18:59');
INSERT INTO `clima_respuestas_abiertas` VALUES (467, 3, 83, 1, 13, 5, 'Su forma de expresarse ( que no parezca que nos trata como tontos cuando preguntamos algo),\nque sea consintiente con su forma de ser, ya que en un momento esta bien y al siguiente parece una persona totalmente diferente \ngritoneando como si no trabajara con profesionales.', '2026-02-05 09:19:02');
INSERT INTO `clima_respuestas_abiertas` VALUES (468, 3, 75, 1, 10, 2, 'Capacitar al responsable del área para ser un buen líder ya que no tiene ni idea que significa.', '2026-02-05 09:21:50');
INSERT INTO `clima_respuestas_abiertas` VALUES (470, 3, 75, 1, 10, 1, 'N/A', '2026-02-05 09:21:02');
INSERT INTO `clima_respuestas_abiertas` VALUES (472, 3, 83, 1, 13, 7, 'No existe comunicación,  pareciera que solo existe su área y que no deben trabajar en equipo. \nya que no comunican que se va hacer cuando se va a hacer,  hasta que se esta ejecutando el proceso y te das cuanta que afecta a tu área \nes cuando te involucras. \nComo resolverlo,  simple, si saben que afecta a otra área deben comunicarle que se va hacer cierta acción y que los involucra, deben aprender a planar y estar consientes \nde los tiempos que les llevara hacer ese proceso ya que van improvisando en el momento  y pareciera que no saben planear nada.', '2026-02-05 09:29:52');
INSERT INTO `clima_respuestas_abiertas` VALUES (477, 3, 427, 1, 12, 2, 'Contar con wifi en el área. Muchas veces no entra la señal del teléfono y no puedo comunicarme adecuadamente con los proveedores que vienen de visita o que se comunican conmigo por teléfono.\nTambién debe haber más espacios de convivencia como los respibreaks a finales de los meses.', '2026-02-05 14:46:40');
INSERT INTO `clima_respuestas_abiertas` VALUES (478, 3, 427, 1, 12, 1, 'Valoro la oportunidad de aprender y crecer profesionalmente por medio de capacitaciones', '2026-02-05 14:46:09');
INSERT INTO `clima_respuestas_abiertas` VALUES (480, 3, 427, 1, 12, 5, 'Que nos proveen de herramientas necesarias y equipos de seguridad pues no se cuenta con el suficiente equipo de protección personal en el laboratorio.', '2026-02-05 14:47:55');
INSERT INTO `clima_respuestas_abiertas` VALUES (481, 3, 427, 1, 12, 7, 'Que las áreas ajenas a Desarrollo y ajenas al área corporativa, en general, tardan en comunicar sus movimientos o procesar las solicitudes. Deberían de facilitar las solicitudes y peticiones mostrando transparencia y compartiendo disponibilidad en almacén o nos otorguen status, por ejemplo, al solicitar muestras a almacén general nos indiquen si ya recolectaron la muestra, si ya lla empacaron y si ya se encuentra en camino.', '2026-02-05 14:51:30');
INSERT INTO `clima_respuestas_abiertas` VALUES (482, 3, 7, 1, 13, 1, 'las oportunidades de tomar decisiones de solución, aplicarlas y la autonomía sobre mi área', '2026-02-06 11:08:23');
INSERT INTO `clima_respuestas_abiertas` VALUES (483, 3, 7, 1, 13, 2, 'La comunicación interdepartamental oportuna', '2026-02-06 11:06:01');
INSERT INTO `clima_respuestas_abiertas` VALUES (484, 3, 7, 1, 13, 5, 'Favorecer el involucramiento oportuno de actividades que afectan varias áreas.', '2026-02-06 11:06:44');
INSERT INTO `clima_respuestas_abiertas` VALUES (485, 3, 7, 1, 13, 7, 'Decisiones unilaterales sobre actividades y  acciones que afectan varias áreas, generado que seamos reactivos y no preventivos.', '2026-02-06 11:08:22');
INSERT INTO `clima_respuestas_abiertas` VALUES (487, 3, 270, 1, 10, 1, 'La libertad de acción, que me permitan implementar acciones de mejora.', '2026-02-06 11:49:43');
INSERT INTO `clima_respuestas_abiertas` VALUES (488, 3, 270, 1, 10, 2, 'La comunicación entre áreas es común que se retrabaje por falta de información o acceso a la misma, así como la autorización de procesos.', '2026-02-06 11:50:39');
INSERT INTO `clima_respuestas_abiertas` VALUES (489, 3, 270, 1, 10, 5, 'Estamos en proceso de adaptación, no identifico alguna acción de mejora, la comunicación es clara y oportuna.', '2026-02-06 11:52:09');
INSERT INTO `clima_respuestas_abiertas` VALUES (490, 3, 270, 1, 10, 7, 'La toma de decisiones, con más de una área es requerido consultar con dirección para poder avanzar en algún proceso básico donde el lider o jefe de área podria decidir de forma oportuna acortando el tiempo de respuesta.', '2026-02-06 11:53:20');
INSERT INTO `clima_respuestas_abiertas` VALUES (492, 4, 1088, 2, 10, 1, 'El ser parte de la capacitación, ya que es un área en la que me gusta desarrollarme', '2026-02-06 12:08:34');
INSERT INTO `clima_respuestas_abiertas` VALUES (493, 4, 1088, 2, 10, 2, 'Tener espacios bien designados en instalaciones para realizar entrevistas y capacitación de personal', '2026-02-06 12:09:39');
INSERT INTO `clima_respuestas_abiertas` VALUES (494, 4, 1088, 2, 10, 5, 'Sin comentarios', '2026-02-06 12:10:14');
INSERT INTO `clima_respuestas_abiertas` VALUES (495, 4, 1088, 2, 10, 7, 'El apoyo en horarios de atención a candidatos, lo mejoraría rotando a los supervisores en la selección y entrevista a candidatos en lugar de solo atenderlos los jefes', '2026-02-06 12:11:43');
INSERT INTO `clima_respuestas_abiertas` VALUES (496, 3, 476, 1, 10, 1, 'Saber que puedo aportar mucho para la CONSECUCIÓN de los objetivos del área. Saber que las necesidades de liderazgo y responsabilidad están alineadas a mi capacidad, criterio, metodología de trabajo y expertise.', '2026-02-06 12:59:57');
INSERT INTO `clima_respuestas_abiertas` VALUES (499, 3, 476, 1, 10, 2, 'Por el momento, puedo mencionar las herramientas técnicas: programas necesarios, plataformas necesarias.', '2026-02-06 13:00:47');
INSERT INTO `clima_respuestas_abiertas` VALUES (500, 3, 476, 1, 10, 5, 'Dar un par de pasos hacia atrás (en el buen sentido de la frase) solo para que su visión pueda abarcar toda la imagen del gran equipo que está construyendo, y hacer los ajustes necesarios de organización, establecimiento de funciones, asignación de funciones, equipamiento de estaciones de trabajo y equipo de cómputo, y programas.', '2026-02-06 13:03:50');
INSERT INTO `clima_respuestas_abiertas` VALUES (501, 3, 476, 1, 10, 7, 'Pienso que en algunas ocasiones falta empatía entre áreas. Desde mi posición, reconozco que mi área ha generado mucha incertidumbre respecto al cumplimiento de objetivos, cosa que estamos trabajando arduamente para erradicar, pero me gustaría que las áreas que interactúan con nosotros supieran eso y entendieran que, apoyar en la consecución de objetivos, NO es ayudarme a mí, sino a los demás empleados y por ende a la empresa en conjunto. En resumen, comunicación efectiva más que asertiva, sin descuidar ambas.', '2026-02-06 13:10:18');
INSERT INTO `clima_respuestas_abiertas` VALUES (504, 3, 14, 1, 4, 1, 'Los retos', '2026-02-06 15:21:48');
INSERT INTO `clima_respuestas_abiertas` VALUES (505, 3, 14, 1, 4, 2, 'recibir a tiempo los materiales', '2026-02-06 15:21:56');
INSERT INTO `clima_respuestas_abiertas` VALUES (506, 3, 14, 1, 4, 5, 'Cominicación', '2026-02-06 15:22:13');
INSERT INTO `clima_respuestas_abiertas` VALUES (507, 3, 14, 1, 4, 7, 'Flujo tardío, lo resolvería con mayor oportunidad.', '2026-02-06 15:22:37');
INSERT INTO `clima_respuestas_abiertas` VALUES (508, 3, 387, 1, 5, 1, 'Valoro que puedo aplicar mi preparación técnica y blanda adquirida durante años, como en la empresa no hay mucho es una oportunidad para desarrollar muchas cosas, sin embargo, el tema es persuadir al personal para que sucedan y sobre todo hacer comprender a mi Jefe como es el deber ser de las cosas, para que reciba su apoyo al 100, de esta forma tendría mayor peso y facilidad hacer que las cosas sucedan.', '2026-02-06 16:18:47');
INSERT INTO `clima_respuestas_abiertas` VALUES (510, 3, 387, 1, 5, 2, 'La cultura, porque no existe un ambiente colaborativo, sino por el contrario siempre buscan un culpable y quieren exponerlo en la mayoría de las ocasiones sin bases sólidas, lo cual genera rivalidades, confusiones, problemas, y que las personas se vean aislados, no como un equipo, la gente no tiene sentido de permanencia, por lo cual le da igual si el resultado sale bien o mal, solo trabajan mecánicamente.', '2026-02-06 16:21:11');
INSERT INTO `clima_respuestas_abiertas` VALUES (511, 3, 387, 1, 5, 5, 'Considero que podría dejarse guiar más por los responsables que tiene a cargo de las áreas que le corresponden, apoyar a que se dé el resultado, se congruente entre lo que dice y hace, dar una dirección clara porque en ocasiones un día es una cosa, otro día es otra, y terminamos haciendo reprocesos, también es importante que genere y promueva la comunicación y el trabajo en equipo de todos sus colaboradores a cargo, apoyar en reforzar los seguimientos para que las demás áreas contesten en tiempo y forma, que genere un criterio propio sobre su equipo y lo defienda cuando hay evidencia para hacerlo, que investigue antes de afirmar un hecho, sin antes consultarlo con su equipo, forma de decir las cosas, que permita el dialogo, que escuche, para mejorar porque no te deja hablar es el único que tiene la razón en varias ocasiones.', '2026-02-06 16:30:53');
INSERT INTO `clima_respuestas_abiertas` VALUES (516, 3, 387, 1, 5, 7, '1. Actividades burocráticas y obsoletas de acuerdo al mercado actual, lo resolvería documentando y mapeando las operaciones de la empresa, invirtiendo en proyectos de digitalización, semiautomatización. \n2. Incumplimiento con los tiempos de entrega, respuesta, fechas compromiso y lo resolvería estandarizando las operaciones a través de políticas y procedimientos, hacer valer esos documentos que si no se llevan a cabo tenga una consecuencia para que los colaboradores cumplan, teniendo el respaldo de todas la Directiva. 3. Falta de conocimiento y liderazgo de varios responsables de área debido a que los promueven en periodos muy cortos de tiempo de madurez en su puesto o la única experiencia laboral que tienen solo es en esta empresa, eso retrasa la documentación y mapeo porque se supone que deberían saber cómo se llevan a cabo sus operaciones y no saben muchas veces, eso incrementa los tiempos para estandarizar y mejorar los procesos, como te va a proponer mejoras alg la experiencia que me puede salir más barato o mejor contratar a personal externo con mayor experiencia con un mayor costo. uien que no sabe lo que está haciendo o no tiene conocimiento al 100 de su área,  lo resolvería analizando los pro y contra de ascender a personal interno sin', '2026-02-06 16:46:20');
INSERT INTO `clima_respuestas_abiertas` VALUES (520, 3, 477, 1, 10, 1, 'El líder que tengo me orienta y dirige para conocer mis funciones', '2026-02-09 08:00:28');
INSERT INTO `clima_respuestas_abiertas` VALUES (521, 3, 477, 1, 10, 2, 'Que los empleados sean más empáticos, trabajen en equipo y sean amables', '2026-02-09 08:01:01');
INSERT INTO `clima_respuestas_abiertas` VALUES (522, 3, 477, 1, 10, 7, 'Que existe totalmente barrera de comunicación, trabajo en equipo y resistencia al cambio', '2026-02-09 08:03:24');
INSERT INTO `clima_respuestas_abiertas` VALUES (524, 3, 477, 1, 10, 5, 'Tener un equipo más robusto de RRHH', '2026-02-09 08:03:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (525, 3, 93, 1, 13, 1, 'Tengo las herramientas necesarias para realizar mis actividades, un lugar y equipo de computo asignado para mi.', '2026-02-09 11:52:35');
INSERT INTO `clima_respuestas_abiertas` VALUES (526, 3, 93, 1, 13, 2, 'Que la empresa sea mas equitativa en cuanto a el apoyo, actividades, comodidad y \"premios\" para todo el personal FH ya que se nota la diferencia de apoyo por sede.', '2026-02-09 11:55:17');
INSERT INTO `clima_respuestas_abiertas` VALUES (527, 3, 93, 1, 13, 5, 'Los crecimientos del personal y/o prestación, ya que en otras áreas se sabe de crecimientos de sus chicos y aumentos por este crecimiento, sin embargo en el área los puestos son mas fijos, quizás porque la actividad y puesto es de nuestro agrado sin embargo aunque llevamos tiempo aquí debería tomarse en cuenta un aumento por el desempeño y/o tiempo laborando en el puesto.', '2026-02-09 12:00:14');
INSERT INTO `clima_respuestas_abiertas` VALUES (528, 3, 93, 1, 13, 7, 'Entiendo que hay jerarquías pero en mi caso a veces necesito', '2026-02-09 12:01:12');
INSERT INTO `clima_respuestas_abiertas` VALUES (529, 3, 18, 1, 2, 1, 'El apoyo que tengo de mis superires y el ambiente laboral en el área que lidereo', '2026-02-09 14:33:25');
INSERT INTO `clima_respuestas_abiertas` VALUES (530, 3, 18, 1, 2, 2, 'Cambiar el horario de 08:00 a 17:00 hrs. por el tráfico de la zona.', '2026-02-09 14:34:07');
INSERT INTO `clima_respuestas_abiertas` VALUES (531, 3, 18, 1, 2, 5, 'Tengo claridad en mi trabajo y cuento con el apoyo, por lo que considero que un buen lider, acompaña y guía, por lo que en mi caso así ha sido', '2026-02-09 14:36:02');
INSERT INTO `clima_respuestas_abiertas` VALUES (532, 3, 18, 1, 2, 7, 'Que tengan orden, respuestas oportunas y asumir responsabilidades para con ello poder mejorar.', '2026-02-09 14:36:52');
INSERT INTO `clima_respuestas_abiertas` VALUES (533, 3, 217, 1, 5, 1, 'ambiente laboral respetuoso y compañerismo', '2026-02-09 14:44:15');
INSERT INTO `clima_respuestas_abiertas` VALUES (534, 3, 217, 1, 5, 2, 'Que los procesos sean más agiles y que las demás áreas te apoyen en enviar la información clara y precisa', '2026-02-09 14:46:43');
INSERT INTO `clima_respuestas_abiertas` VALUES (539, 3, 217, 1, 5, 7, 'El que manden la información bien y con tiempo para evitar retrasos', '2026-02-09 14:47:36');
INSERT INTO `clima_respuestas_abiertas` VALUES (540, 3, 217, 1, 5, 5, 'Tener más apoyo para que las demás áreas me envíen la información que se requiere en tiempo.', '2026-02-09 14:48:58');
INSERT INTO `clima_respuestas_abiertas` VALUES (541, 3, 344, 1, 9, 1, 'el crecimiento que puede haber dentro de la misma, la sincronía que se ha formado dentro del área de trabajo', '2026-02-09 15:20:33');
INSERT INTO `clima_respuestas_abiertas` VALUES (542, 3, 344, 1, 9, 2, 'los recursos con los que se cuentan actualmente y la importancia que se le da al área de mkt digital', '2026-02-09 15:21:09');
INSERT INTO `clima_respuestas_abiertas` VALUES (543, 3, 344, 1, 9, 5, 'bajar la información completa en tiempo y forma para su desarrollo, la comunicación directa y efectiva con cada uno de los integrantes del área, el conocimiento de los procesos de cada integrante', '2026-02-09 15:22:06');
INSERT INTO `clima_respuestas_abiertas` VALUES (544, 3, 344, 1, 9, 7, '', '2026-02-09 15:22:15');
INSERT INTO `clima_respuestas_abiertas` VALUES (545, 3, 285, 1, 12, 1, 'el compañerismo, trabajo en equipo, en equilibrio trabajo-vida social y la oportunidad de aprender mas', '2026-02-09 15:45:21');
INSERT INTO `clima_respuestas_abiertas` VALUES (549, 3, 285, 1, 12, 2, 'Me gustaría que los objetivos del equipo estuvieran mejor definidos y priorizados, así como contar con canales de comunicación más claros, para asegurar que todos trabajemos alineados hacia las mismas metas', '2026-02-09 15:48:05');
INSERT INTO `clima_respuestas_abiertas` VALUES (550, 3, 285, 1, 12, 5, 'comunicacion clara y a timepo. Sería de gran apoyo contar con instrucciones y expectativas más claras desde el inicio de los proyectos, así como con una comunicación más estructurada. Esto facilitaría la organización del trabajo y el cumplimiento eficiente de metas.', '2026-02-09 15:49:47');
INSERT INTO `clima_respuestas_abiertas` VALUES (551, 3, 285, 1, 12, 7, 'con mi ccordinadora', '2026-02-09 15:49:58');
INSERT INTO `clima_respuestas_abiertas` VALUES (552, 3, NULL, 1, 4, 1, 'que me hayan dado la oportunidad de ser encargada del área por que así me involucro con documentación y procesos que no conocía. no es lo mismo ver que hacer', '2026-02-09 16:05:21');
INSERT INTO `clima_respuestas_abiertas` VALUES (553, 3, NULL, 1, 4, 2, 'pues que pudieran cambiar a una compañera por que cuando me llegan a poner en el área como encargada ella se mete y dirige a la gente y no se le puede decir nada por que se ofende y también a otra compañera por que cuando uno les da una orden se enojan y hasta gritonean que yo no soy nadie para dirigir la línea y ya se lo toman muy personal conmigo, ya ni puedo platicar en el baño. Sandra García y ...', '2026-02-09 16:05:21');
INSERT INTO `clima_respuestas_abiertas` VALUES (554, 3, NULL, 1, 4, 5, 'Pues que pudiera reconocer mi trabajo y que no se dejara llevar por comentarios que hacen las compañeras, que fuera neutral ni para un lado ni para el otro ni dejando de hacer la barba por que luego le trae el desayuno o la comida y luego con eso la gente se la gana y los que en verdad trabajan los anda regañando por que uno no le hace la barba.', '2026-02-09 16:05:21');
INSERT INTO `clima_respuestas_abiertas` VALUES (555, 3, NULL, 1, 4, 7, 'pues que cuando no hay trabajo y que si no hay te hacen venir hasta en tiempo nocturno y sin hacer nada. Mejor que planeen bien los tiempos de trabajo y que los equipos estén al 100& para producción.', '2026-02-09 16:05:21');
